import React from 'react';
import "./style.sass"

interface InputProps{
    onChange: (event: React.ChangeEvent<HTMLInputElement>) => void;
    entityList: {id: string, name: string}[];
}
export const Checkbox: React.FC<InputProps> = ({ entityList, onChange}) => {
    return (
        <div className="col-sm-6">
            {entityList.map(entity => (
                <>
                    <input type="checkbox" id={entity.name} name={entity.name} value={entity.id} onChange={onChange}/>
                    <label htmlFor="vehicle1">{entity.name}</label><br/></>
                ))}

        </div>

    );
};
